import React from "react";
import c from "./contacts.module.css"

const Contacts = ({name, status, key}) => {
    console.log(key)
    return (
        <div className={c.contactsContainer}>
            <div>{name}</div>
            <div>{status}</div>
        </div>
    )
}

export default Contacts
